import React from "react";

const About: React.FC = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>Welcome to our website! We are a team of dedicated individuals passionate about what we do. Our mission is to provide valuable information and services to our users.</p>
      <p>With years of experience in our field, we strive for excellence and aim to make a positive impact in the world.</p>
      <img src="your-image.jpg" alt="About Us" />
    </div>
  );
};

export default About;
